import React from 'react';
import {Container, AppBar, Typography,Button, Grow, Grid} from '@material-ui/core'; //Grid is used for a simple animation. you may not need it
import Carousel from 'react-material-ui-carousel'; //I read documentation separately
import Posts from './components/Posts/Posts.js';
import Form from './components/Form/form.js';

//This is just to test the Carousel
var testList = [1,2,3,4,5];

function handleClick(){
  return (<Form/>)
}

function App() {
  return (
    <Container maxwidth="lg">
    <AppBar color="inherit" position="static">
        <Typography variant="h2" aligh="left">WIT Blog</Typography>
        <Button onCLick={handleClick} align="right" variant="outlined">+</Button>
    </AppBar> 

    <Carousel>
    {
      testList.map(() => {
       return(<Posts/>)
      })
    }
</Carousel>
</Container>
  );
}

export default App;
